import React from "react";
import "./Chat.css";
import { Avatar } from "@material-ui/core";

function Chat() {
  return (
    <div className="chat">
      <div className="chat__header">
        <Avatar />
        <h2>Room name</h2>
        <p>Last seen timestamp</p>
      </div>
      <div className="chat__body"></div>
      <div className="chat__footer"></div>
    </div>
  );
}

export default Chat;
